import React from 'react';
import s from './Profile.module.css'
import Post from "./MyPosts/MyPost";
import MyPost from "./MyPosts/MyPost";
import ProfileInfo from "./PofileInfo/ProfileInfo";
let PostData = [
    {id:1,text:'acascascascsac',like:22},
    {id:2,text:'acascascascsac',like:22},
    {id:3,text:'acascascascsac',like:22},
    {id:3,text:'acascascascsac',like:22},
    {id:3,text:'acascascascsac',like:22},
    {id:3,text:'acascascascsac',like:22},
    {id:4,text:'acascavdvdvdscascsac',like:22}
]
const Profile = (props) => {
    return (
        <div>
            <ProfileInfo/>
            <MyPost PostData={PostData}/>
        </div>
    );
}
export default Profile;
